/* To remove line spacing on the Chatter feed */
.slds-feed__item {
    padding-top: 0;
}

.forceChatterStyle--default .cuf-feedElement.cuf-feedElement {
    padding-bottom: 0 !important;
    padding-top: 0 !important;
}

/* To position the Profile Menu in the Header */
.cProfileMenu {
    margin-right: 0.5rem;
    width: 100%;
}

/* To position the Profile Menu in the Header - check if still necessary */
.selfServiceUserProfileMenu {
    float: right;
}

/* To position the StarTrack Logo in the Header */
.siteforcePrmBody .cHeader .cBrandingLogo {
    height: 40px !important;
    width: 130px !important;
}

/* To remove default box-shadow */
.siteforcePrmBody .cHeader {
    box-shadow: none;
}

/* To hide the Global Nav */
.forceCommunityGlobalNavigation {
    display: none;
}

/* To control visibility of Chatter Feed component actions */
.slds-post__footer {
    display: none;
}

/* To control visibility of Chatter Feed component actions */
.cuf-feedback {
    display: none;
}

/* To control visibility of Chatter Feed component actions */
.cuf-ftcLink {
    display: none !important;
}

/* To control visibility of Chatter Feed component actions */
.cuf-moreFtcs {
    display: none !important;
}

/* To control visibility of View-More section on the feed */
.forceChatterFeedAuxBodyRecordSummary--default .rsLink {
    display: none !important;
}

/* To position attachment pop-up */
.cImageContainer.popup .popuptext {
    margin-left: -600px !important;
    top: 0 !important;
    width: 800px !important;
}

